script: |
  super -f text -I q5433.spq | sort > q5433.out

inputs:
  - name: q5433.spq
    data: |
      SELECT ALL + col0 AS col1, col2, + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 82 - col1 * - col1 / + col2 + col1 - - col0 + + 38 IS NOT NULL;
  - name: tab1

outputs:
  - name: q5433.out
    data: |
      51	96	96
      85	59	59
      91	68	68
